import './style.css';
import linkedinIco from "../../assets/img/linkedin.png";
import githubIco from "../../assets/img/github.png";
import ggmailIco from "../../assets/img/ggmail.png";




  function About(props) {

    return (


      <div className="about-div">

        <p id="p-desc">{props.description}</p>

        <a className="shortcuts" href={props.linkedin}>
          <img id="icon-linkedin" src={linkedinIco}/>
        </a>

        <a className="shortcuts" href={props.github}>
          <img id="icon-github" src={githubIco}/>
        </a>

        <a className="shortcuts" href={props.gmail}>
          <img id="icon-gmail" src={gmailIco}/>
        </a>


      </div>
      
    )



  }


  export default About;
